import React from 'react';
import { Link } from 'react-router-dom';
import JobDropDownMenu from '../components/JobDropDownMenu'

const HomePage = () => (
  <>
    <h1>Employment Website</h1>
    <img src="/public/home.jpg" alt="Homepage" />
      <p>
         Job search made easy!<br />
         Register, entering all your details once.<br />
         Then, browse jobs and apply directly.<br />
         Or go to your profile and press "Find Job"<br />
         This will automatically send your application to all current and future employers whose requirements you match!
      </p>
    <div>
      <Link to={'/vacancies/'}>View vacancies</Link>
    </div>
  </>
);


export default HomePage;
